StoredProcedureSqlServerv2k5.body:
@OssAnnualObjec.veId int, 
      @Organiza.onId int, 
      @FiscalYear int, 
      @AdjBusPercentTC int, 
      @AdjBusPercentOT int, 
      @AdjBusPercentAC int, 
      @AdjBusPercentDC int, 
      @ContractGoal int, 
      @GoalPercentJUL int, 
      @GoalPercentAUG int, 
      @GoalPercentSEP int, 
      @GoalPercentOCT int, 
      @GoalPercentNOV int, 
      @GoalPercentDEC int, 
      @GoalPercentJAN int, 
      @GoalPercentFEB int, 
      @GoalPercentMAR int, 
      @GoalPercentAPR int, 
      @GoalPercentMAY int, 
      @GoalPercentJUN int, 
      @LastUpdateUserId int      

AS 
SET NOCOUNT ON 


IF EXISTS (SELECT '1' from [USMC].[OssAnnualObjec.ve] WHERE [OssAnnualObjec.veId] = @OssAnnualObjec.veId) 

 BEGIN 

 UPDATE [MCRISS].[USMC].[OssAnnualObjec.ve] 
  SET   
   [Organiza.onId] = @Organiza.onId, 
   [FiscalYear] = @FiscalYear, 
   [AdjBusPercentTC] = @AdjBusPercentTC, 
   [AdjBusPercentOT] = @AdjBusPercentOT, 
   [AdjBusPercentAC] = @AdjBusPercentAC, 
   [AdjBusPercentDC] = @AdjBusPercentDC, 
   [ContractGoal] = @ContractGoal, 
   [GoalPercentJUL] = @GoalPercentJUL, 
   [GoalPercentAUG] = @GoalPercentAUG, 
   [GoalPercentSEP] = @GoalPercentSEP, 
   [GoalPercentOCT] = @GoalPercentOCT, 
   [GoalPercentNOV] = @GoalPercentNOV, 
   [GoalPercentDEC] = @GoalPercentDEC, 
   [GoalPercentJAN] = @GoalPercentJAN, 
   [GoalPercentFEB] = @GoalPercentFEB, 
   [GoalPercentMAR] = @GoalPercentMAR, 
   [GoalPercentAPR] = @GoalPercentAPR, 
   [GoalPercentMAY] = @GoalPercentMAY, 
   [GoalPercentJUN] = @GoalPercentJUN, 
   [LastUpdateUserId] = @LastUpdateUserId,    
   [LastUpdatedDate]= GetDate() 
  WHERE [OssAnnualObjec.veId] = @OssAnnualObjec.veId 

 END 
 ELSE 
 BEGIN 


  INSERT INTO [MCRISS].[USMC].[OssAnnualObjec.ve] ( 
   [Organiza.onId], 
   [FiscalYear], 
   [AdjBusPercentTC], 
   [AdjBusPercentOT], 
   [AdjBusPercentAC], 
   [AdjBusPercentDC], 
   [ContractGoal], 
   [GoalPercentJUL], 
   [GoalPercentAUG], 
   [GoalPercentSEP], 
   [GoalPercentOCT], 
   [GoalPercentNOV], 
   [GoalPercentDEC], 
   [GoalPercentJAN], 
   [GoalPercentFEB], 
   [GoalPercentMAR], 
   [GoalPercentAPR], 
   [GoalPercentMAY], 
   [GoalPercentJUN], 
   [LastUpdateUserId],    
   [LastUpdatedDate] 
   ) 
  VALUES ( 
   @Organiza.onId, 
   @FiscalYear, 
   @AdjBusPercentTC, 
   @AdjBusPercentOT, 
   @AdjBusPercentAC, 
   @AdjBusPercentDC, 
   @ContractGoal, 
   @GoalPercentJUL, 
   @GoalPercentAUG, 
   @GoalPercentSEP, 
   @GoalPercentOCT, 
   @GoalPercentNOV, 
   @GoalPercentDEC, 
   @GoalPercentJAN, 
   @GoalPercentFEB, 
   @GoalPercentMAR, 
   @GoalPercentAPR, 
   @GoalPercentMAY, 
   @GoalPercentJUN, 
   @LastUpdateUserId,    
   GetDate() 
   )   

 END 

--- CLEAN UP 
SET NOCOUNT OFF
